import React, { useState } from 'react';
import profilePostFoto1 from '../../icons/profPost1.jpeg';
import profilePostFoto2 from '../../icons/profPost2.jpeg';
import profilePostFoto3 from '../../icons/profPost3.jpeg';
import profilePostFoto4 from '../../icons/profPost4.jpeg';
import profilePostFoto5 from '../../icons/profPost5.jpeg';
import profilePostFoto6 from '../../icons/profPost6.jpeg';
import profilePostFoto7 from '../../icons/profPost7.jpeg';
import profilePostFoto8 from '../../icons/profPost8.jpeg';
import LikesAndComment from './LikesAndComment';
import '../../pages/Profile/Profile.scss';

const ProfilePosts = () => {
  const [showModal, setShowModal] = useState(false);

  const staticProfilePhotos = [
    { postPhoto: profilePostFoto1, likes: 43, comments: 12 },
    { postPhoto: profilePostFoto2, likes: 43, comments: 12 },
    { postPhoto: profilePostFoto3, likes: 43, comments: 12 },
    { postPhoto: profilePostFoto4, likes: 43, comments: 12 },
    { postPhoto: profilePostFoto5, likes: 43, comments: 12 },
    { postPhoto: profilePostFoto6, likes: 43, comments: 12 },
    { postPhoto: profilePostFoto7, likes: 43, comments: 12 },
    { postPhoto: profilePostFoto8, likes: 43, comments: 12 },
  ];

  const handleShowModal = () => {
    setShowModal(!showModal);
  };

  return (
    <div className="prof__posts">
      {staticProfilePhotos.map((post) => (
        <div className="prof__post-item">
          <img className="prof__posts-photo" src={post.postPhoto} alt="post-foto1" />
          <LikesAndComment likes={43} comments={12} />
        </div>
      ))}

      <div className="prof__post-item">
        <img className="prof__posts-photo" src={profilePostFoto2} alt="post-foto2" />
        <LikesAndComment likes={63} comments={6} />
      </div>
      <div className="prof__post-item">
        <img className="prof__posts-photo" src={profilePostFoto3} alt="post-foto3" />
        <LikesAndComment likes={52} comments={8} />
      </div>
      <div className="prof__post-item">
        <img className="prof__posts-photo" src={profilePostFoto4} alt="post-foto4" />
        <LikesAndComment likes={55} comments={22} />
      </div>
      <div className="prof__post-item">
        <img className="prof__posts-photo" src={profilePostFoto5} alt="post-foto5" />
        <LikesAndComment likes={76} comments={3} />
      </div>
      <div className="prof__post-item">
        <img className="prof__posts-photo" src={profilePostFoto6} alt="post-foto6" />
        <LikesAndComment likes={65} comments={4} />
      </div>
      <div className="prof__post-item">
        <img className="prof__posts-photo" src={profilePostFoto7} alt="post-foto7" />
        <LikesAndComment likes={57} comments={11} />
      </div>
      <div className="prof__post-item">
        <img className="prof__posts-photo" src={profilePostFoto8} alt="post-foto8" />
        <LikesAndComment likes={73} comments={3} />
      </div>
    </div>
  );
};

export default ProfilePosts;
